function drawVisualizer(bufferLength,x,barWidth,barHeight,dataArray){
    for(let i=0;i<bufferLength;i++){
        barHeight = dataArray[i]*1.5+150;
        ctx.save();
        ctx.translate(canvas.width/2,canvas.height/2);
        ctx.rotate(i*Math.PI*8/bufferLength);//+ for chakra, * for circle
        const hue = i;
        ctx.fillStyle = 'hsl(' + hue +',100%,'+barHeight/6+'%)';
        ctx.fillRect(0,0,barWidth,barHeight);   
         x += barWidth;
         ctx.restore();
    }
}
function drawVisualizer1(bufferLength,x,barWidth,barHeight,dataArray){
    for(let i=0;i<bufferLength;i++){
        barHeight = dataArray[i]*2;
        const red = i * barHeight/20;
        const green = i *4;
        const blue = barHeight/2;
        ctx.fillStyle = 'white';
        ctx.fillRect(canvas.width/2 - x, canvas.height - barHeight-30,barWidth,20);   
        ctx.fillStyle = 'rgb('+red+','+green+','+blue+')';
        ctx.fillRect(canvas.width/2 - x, canvas.height - barHeight,barWidth,barHeight);   
         x += barWidth;
    }
    for(let i=0;i<bufferLength;i++){
        barHeight = dataArray[i]*2;
        const red = i * barHeight/20;
        const green = i *4;
        const blue = barHeight/2;
        ctx.fillStyle = 'white';
        ctx.fillRect(x, canvas.height - barHeight-30,barWidth,20);   
        ctx.fillStyle = 'rgb('+red+','+green+','+blue+')';
        ctx.fillRect(x, canvas.height - barHeight,barWidth,barHeight);   
         x += barWidth;
    }
}

